---

### Longitudinal Data
- Observations are collected for the same subject over a period of time
- Example: Tracking a company's annual revenue and number of employees over several years

## Variable Types

---



## Variable Types

We have two general types: .blue[Categorical] and .blue[Numerical] variables

### Categorical Variables

- Variables that can be divided into one or more groups or categories.
  - **Ordinal:** These variables can be logically ordered or ranked. 
      - *Variable:* Customer Satisfaction Survey Results
      - *Example:* Very Unsatisfied, Unsatisfied, Neutral, Satisfied, Very Satisfied

  - **Nominal:** These variables cannot be ordered or ranked. 
      - *Variable:* Social Media Platforms Used
      - *Example:* Facebook, Instagram, Twitter, LinkedIn, TikTok, Snapchat

---

### Numerical Variables

- Variables that hold numeric data.
  - **Discrete:** These variables can only take certain values
      - *Example*: Number of App Downloads from App Store
      - *Example*: Number of children you have
      
  - **Continuous:** These variables can take any value within a range
      - *Example*: Time (in seconds) Spent on a Webpage
      - *Example*: Exchange rate between MXN and USD

---

# Summarizing Data 

## Graphical summaries

---

### Categorical variables
###Frequency Tables

**Frequency table**: present the absolute frequencies (counts) and relative frequencies (shares) of each category. 
- Relative frequency of category `\(i\)`: `\(p_i=\frac{n_i}{N}\)`
    - `\(n_i\)` is count of category `\(i\)`
    - `\(N\)` is total count in the sample

- Most values never repeat, so they have very low relative frequency

---
## Histograms

**Solution**: Group similar values together
- Construct intervals and show how many observations are in a given interval

--

**Process**
  1. Decide how many intervals 
  2. And how wide they are
  3. Then calculate the absolute and relative frequencies of each interval
  4. Plot it with bars 
  
--

---

**My approach**
  - I want `\(k\)` (example `\(k\)`=5) equal intervals
  
--
  
  - Divide the range of the data into `\(k\)` equal intervals
    
--
  
      - *Range* is max-min of the data
        
--
  

```r
# Calculate max and min
max_value &lt;- max(Health_data$weight)
min_value &lt;- min(Health_data$weight)

# Calculate the difference
range &lt;- max_value - min_value
```
  
--
  

```
## [1] "Range= 190.8078 - 30.3745 = 160.4333"
```
  
--
  
- With 5 intervals, each will be 32kg wide
--
  
- The first one starts at the minimum value (30.3745)
--
  
- The last one ends at the maximum value (190.8078)
--

- Calculate how many observations I have in each interval and what's the relative frequency

---

## Histograms

- Midpoint represents middle of the interval - center of the bar
- `\(P_i\)` is cumulative frequency: share of observations in this or smaller interval
  - *Example*: `\(P_{(62.46-94.55)}=0.911\)`  
  - *Interpretation*: 91.1% of people have weight lower than 94.55kg

## Probability Density Function (PDF)

### Definition
- **Probability Density Function (pdf)**  describes the probability distribution of a continuous random variable. 
- The PDF represents the likelihood of the random variable taking on a specific value within a given range. 
- Unlike the probability mass function (PMF) for discrete variables, the PDF does not give the probability of exact values but provides the relative likelihood of the random variable being within a certain interval.

--

### Example
Suppose we have a random variable X representing the weight of adults in Mexican population. The PDF of X would describe the likelihood of finding a person of a specific weight within a range (e.g., between 58kg and 60kg).

---

### How They Work
To calculate the probability of X falling within a specific range [a, b], you need to integrate the PDF from a to b:

`\(P(a \leq X \leq b) = \int_{a}^{b} f(x) \, dx\)`

The total area under the PDF curve is equal to 1

`\(P(a \leq X \leq b) = \int_{a}^{b} f(x) \, dx\)`

`\(P(a \leq X \leq b) = \int_{a}^{b} f(x) \, dx\)`

## Cumulative Distribution Function (CDF)


The Cumulative Distribution Function (CDF) is another important concept in probability and statistics. The CDF gives the probability that a continuous random variable X will take on a value less than or equal to a specific value x.

For a continuous random variable X with PDF f(x), the CDF F(x) is defined as:

`\(F(x) = \int_{-\infty}^{x} f(t) \, dt = P(X&lt;x)\)`

The CDF provides a cumulative view of the probability distribution and is useful for calculating probabilities over intervals and finding percentiles. The CDF starts at 0 and approaches 1 as x approaches infinity since the probability of X being less than or equal to negative infinity is 0, and the probability of X being less than or equal to positive infinity is 1.
---

## Example 1: Standard Normal

`\(F(-2) = \int_{-\infty}^{-2} f(t) \, dt = P(X&lt;-2)=0.02\)`

![](C_2_slides_files/figure-html/example1-1.png)&lt;!-- --&gt;

---

## Example 2: Standard Normal

`\(F(0.2) = \int_{-\infty}^{0.2} f(t) \, dt = P(X&lt;0.2)=0.58\)`

![](C_2_slides_files/figure-html/example2-1.png)&lt;!-- --&gt;

---

## Example 3: Standard Normal

`\(F(3.2) = \int_{-\infty}^{3.2} f(t) \, dt = P(X&lt;3.2)=0.99\)`


![](C_2_slides_files/figure-html/example3-1.png)&lt;!-- --&gt;

### Empirical CDF

We can do similar thing with our weight data. 

`\(ECDF(x)=\frac{\sum I(w_i&lt;x)}{N}=\frac{\text{Number of people with weight lower than x}}{N}\)`
 
- `\(I(w_i&lt;x)=1\)` if weight of person `\(i\)` is lower than `\(x\)` (*Indicator Function*)
- `\(N\)` is total number of people (*Sample Size*)
- Share of people with weight lower than x

# Measures of Central Tendency
## Mean

- **Mean** represents the arithmetic average of the data.
- The population mean `\(\mu\)` is the sum of all observations divided by the total population size:

$$\mu = \frac{\sum_{i=1}^{N} x_i}{N} $$

- where `\(N\)` is the total population size, and `\(x_i\)` are individual data points.


- The sample mean, denoted as `\(\bar{x}\)`, is the sample equivalent:

`$$\bar{x} = \frac{\sum_{i=1}^{n} x_i}{n} = \frac{x_1+x_2+...x_{n-1}+x_n}{n}$$`

where `\(n\)` is the sample size.

Intuitively, mean is the balancing point of the distribution.

## Weighted Mean

- In some scenarios, data points have different weights. 
- For a dataset with weights `\(w_i\)` and values `\(x_i\)`, the weighted mean is:

`$$\text{Weighted Mean} = \frac{\sum_{i=1}^{n} w_i \cdot x_i}{\sum_{i=1}^{n} w_i}$$`

## Median

- **Median** represents the middle value when data is sorted
- Half of observations are below it, half are above it.
- For a dataset with odd size `\(n\)`, the median is the `\(\frac{n+1}{2}\)`-th value
- For even size `\(n\)`, it's the average of `\(\frac{n}{2}\)`-th and `\(\frac{n}{2}+1\)`-th values.

.pull-left[
| Day | Number of Customers |
|-----|---------------------|
| 1   | 20                  |
| 2   | 18                  |
| 3   | 25                  |
| 4   | 22                  |
| 5   | 30                  |
| 6   | 21                  |
| 7   | 27                  |
]

.pull-right[
The dataset has `\(n=7\)` (odd) observations, so to find the median:

- Arrange the data in ascending order:
    - 18, 20, 21, 22, 25, 27, 30.
- The median is the `\(\frac{n+1}{2}\)`-th value, which is the 4th value.
- Thus, the median is the 4th value, which is 22.
]
